      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (867,'Indicates whether the entity has ever been listed as one of the largest private companies in the United States on the annual list compiled and published by Forbes magazine.- If true, the entity has been listed.- If false, the entity has not been listed.','Forbes Largest Company Indicator','Boolean','organization.isForbesLargestPrivateCompaniesListed','isforbeslargestprivatecompanieslisted','false');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (868,'Indicates whether the entity has ever been listed as one of the 1000 largest American companies, ranked on revenues alone by the American business magazine Fortune.- If true, the entity has been listed.- If false, the entity has not been listed.','Fortune 1000 Indicator','Boolean','organization.isFortune1000Listed','isfortune1000listed','false');
