      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (871,'When set to \"true\", it denotes that the Dun & Bradstreet is unable to classify the subject into a specific industry.When set to \"false\", it denotes that the Dun & Bradstreet is able to classify the subject into a specific industry.','Non Classified Establishment Indicator','Boolean','organization.isNonClassifiedEstablishment','isnonclassifiedestablishment',NULL);
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (872,'Indicates if the business qualifies as small business, eligible for assistance from SBA, with a place of business located in the United States. It must operate primarily within the United States or make a significant contribution to the U.S. economy through payment of taxes or use of American products, materials or labor. Together with its affiliates, it must meet the numerical size standards as defined in the Small Business Size Regulations 13 CFR 121.- If true, indicates that this is a small business.- If false, indicates that this is not a small business','Is Small Business Indicator','Boolean','organization.isSmallBusiness','issmallbusiness','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (873,'Indicates if the entity is a member of a legal family tree. - If true, indicates that the entity is not a member of a legal family tree.  This means it cannot play any family tree role and corporateLinkage will not be present.- If false, indicates that the entity is a member of a legal family tree.  The roles it plays is indicated by Family Tree Member Roles played.','Standalone Indicator','Boolean','organization.isStandalone','isstandalone','false');
