      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (878,'A note providing further information about the financial statement. For example this might clarify the basis under which the Financial Statement has been prepared (e.g., The Fixed Assets figure is shown net less undisclosed accumulated depreciation) or provide additional information, obtained from the accounts, concerning the entity\'s finances  (e.g., The subject\'s parent company has guaranteed all of its debts).','Organization Latest Financials Comments Description','String','organization.latestFinancials.comments.description','latestfin_comments_desc','Assets have been valued according to the Current Cost convention');
