      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (889,'The date when the company filed its financial statement with an official registry.','Latest Financials Filing Date','String','organization.latestFinancials.filingDate','latestfin_filingdate','2018-02-01');
