      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (891,'A unique code assigned by Dun & Bradstreet to identify the account for the monetary amount recorded in Item Amount.','Latest Financials Ratios Statement Item Key Code','Integer','organization.latestFinancials.financialRatios.statementItems.itemKey.dnbCode','latestfin_finratios_stmt_key_code','584');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (892,'The quartile into which the entity falls with respect to entities in the same industry for this Derived Financial Item Code.- If the financial ratio is greater than or equal to the industry upper quartile, entity is assigned 4.- If the financial ratio is greater than or equal to the industry median, but less than the industry upper quartile, entity is assigned 3.- If the financial ratio is greater than the industry lower quartile, but less than the industry median, the entity is assigned 2.- If the financial ratio is less than or equal to the industry lower quartile, the entity is assigned 1.','Latest Financials Ratios Statement Item Industry Rank','String','organization.latestFinancials.financialRatios.statementItems.relativeIndustryRank','latestfin_finratios_stmt_relativeindrank','4');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (893,'The proportion of one or more of the entity\'s financial figures in relation to one or more of the entity\'s other financial figures.  This figure is an indicator used to evaluate the entity\'s financial condition or potential risk.  For example, a Quick Ratio, which is the sum of an entity\'s cash and accounts receivable amounts divided by its current liabilities, is a predictor of how likely the business is to pay its bills on time.        ','Latest Financials Ratios Statement Item Value','Double','organization.latestFinancials.financialRatios.statementItems.value','latestfin_finratios_stmt_val','75');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (894,'The period of the financial statement expressed as a time interval.Values are in the formatsP<number>M; where <number> = the number of months the statement coversP<number>Y; where <number> = the number of years the statement covers','Latest Financial Statement Duration','String','organization.latestFinancials.financialStatementDuration','latestfin_fintatementduration','P12M');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (895,'The date on which the accounting period commenced.Format: YYYY-MM-DD or YYYY-MM','Latest Financial Statement From Date','String','organization.latestFinancials.financialStatementFromDate','latestfin_fintatementfromdate','2010-03-14');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (896,'The date when the accounting period ended. If the figures are projected (future), then this is the date when the accounting period will end.Format: YYYY-MM-DD or YYYY-MM','Latest Financial Statement To Date','String','organization.latestFinancials.financialStatementToDate','latestfin_fintatementtodate','2011-03-14');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (897,'Indicates whether the financial information is complete.- If true, the information is not complete.- If false, the information is complete.','Latest Financials Partial Information','Boolean','organization.latestFinancials.hasPartialInformation','latestfin_haspartialinfo','false');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (898,'High-level information that allows identification of the Financial Statement.','Latest Financials Header Text','String','organization.latestFinancials.headerDescription','latestfin_headerdesc','Company X 2018 Q1');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (899,'The organizational scope of the financial summary (e.g., Individual (Organization including any branches), Consolidated (Organization including any branches and subsidiaries)).','Latest Financials Information Scope Text','String','organization.latestFinancials.informationScope.description','latestfin_infoscope_desc','Consolidated');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (900,'A unique code assigned by Dun & Bradstreet to identify the organizational scope of the financial summary.','Latest Financials Information Scope Code','Integer','organization.latestFinancials.informationScope.dnbCode','latestfin_infoscope_code','9067');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (901,'The name of the person who was the information source for the Financial Statement.  ','Latest Financials Information Source Name','String','organization.latestFinancials.informationSourceIndividual.fullName','latestfin_infosourceindividual_fullname','John Smith');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (902,'The title of the person who was the information source for the Financial Statement.','Latest Financials Information Source Title','String','organization.latestFinancials.informationSourceIndividual.title','latestfin_infosourceindividual_title','CFO');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (903,'Indicates if the accounts have been reviewed by a qualified accountant independent of the business and the accountant has signed the financial statement certifying it is accurate and complete.- If true, indicates the accounts have been reviewed by an intendent accountant.- If false, indicates the accounts have not been reviewed by an intendent accountant.','Latest Financials Audit Indicator','Boolean','organization.latestFinancials.isAudited','latestfin_isaudited','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (904,'Indicates whether the accounts have been reviewed by a qualified accountant independent of the business and the accountant has signed the financial statement certifying it is accurate and complete.- If true, accounts have been reviewed by a qualified accountant.- If false, accounts have not been reviewed by a qualified accountant.','Latest Financials Audit Unknown indicator','Boolean','organization.latestFinancials.isAuditUnknown','latestfin_isauditunknown','false');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (905,'Indicates whether the financial figures are for the entity\'s closing statement. - If true, the financial figures are for the entity\'s closing statement.- If false, the financial figures are not for the entity\'s closing statement.','Latest Financials Final Indicator','Boolean','organization.latestFinancials.isFinal','latestfin_isfinal','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (906,'Indicates whether the financial figures covers a full year accounting period (normally 12 months, but may vary).- If true, the financial figures cover a full year accounting period.- If false, the financial figures do not cover a full year accounting period.','Latest Financials Fiscal Indicator','Boolean','organization.latestFinancials.isFiscal','latestfin_isfiscal','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (907,'Indicates whether the financial figures declare the financial state of the business on its very first day of trading.- If true, the financial figures declare the financial state of the business on its very first day of trading.- If false, the financial figures do not declare the financial state of the business on its very first day of trading.','Latest Financials Forecast Indicator','Boolean','organization.latestFinancials.isForecasted','latestfin_isforecasted','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (908,'Indicates if the financial figures cover a full year accounting period, which is normally 12 months, but which may be shorter or longer.- If true, the financial figures cover a full year accounting period.- If false, the financial figures do not cover a full year accounting period.','Latest Financials Interim Indicator','Boolean','organization.latestFinancials.isInterim','latestfin_isinterim','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (909,'Indicates whether the financial figures declare the financial state of the business on its very first day of trading.- If true, the financial figures declare the financial state of the business on its very first day of trading.- If false, the financial figures do not declare the financial state of the business on its very first day of trading.','Latest Financials Opening Indicator','Boolean','organization.latestFinancials.isOpening','latestfin_isopening','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (910,'Indicates whether the financial statement is a presentation of a hypothetical balance sheet and income statement based on a set of assumptions.- If true,  the financial statement is a presentation of a hypothetical balance sheet and income statement based on a set of assumptions.- If false  the financial statement is not a presentation of a hypothetical balance sheet and income statement based on a set of assumptions.','Latest Financials Pro forma Indicator','Boolean','organization.latestFinancials.isProforma','latestfin_isproforma','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (911,'Indicates whether the report of the auditors that  accompanied the financial statement had remarks regarding the figures. Auditor remarks may, for example, refer to the fairness and accuracy of the figures or state that the financial well-being of the company is based on assumptions, such as the continued financial support by the parent company.- If true, the auditors\' report has remarks.- If false, the auditors\' report does not have remarks.','Latest Financials Audit Qualified Indicator','Boolean','organization.latestFinancials.isQualified','latestfin_isqualified','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (912,'Indicates whether the financial figures for the financial statement have been revised and re-presented by the business.- If true, the figures have been revised.- If false, the figures have not been revised.','Latest Financials Re-stated Indicator','Boolean','organization.latestFinancials.isRestated','latestfin_isrestated','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (913,'Indicates whether the Financial Statement information contains the signature(s) of the principal(s) of this entity signifying that it is approved.- If true, the Financial Statement information contains the signature(s) of the principal(s) of this entity signifying that it is approved.- If false, the Financial Statement information does not contain the signature(s) of the principal(s) of this entity signifying that it is approved.','Latest Financials Signed Indicator','Boolean','organization.latestFinancials.isSigned','latestfin_issigned','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (914,'Indicates whether the financial statement is a Trial Balance.- If true, the financial statement is a Trial Balance.- If false, the financial statement is not a Trial Balance.','Latest Financials Trial Balance Indicator','Boolean','organization.latestFinancials.isTrialBalance','latestfin_istrialbalance','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (915,'Indicates if the balance sheet is unbalanced.- If true, the balance sheet does not balance. - If false, the balance sheet balances. ','Latest Financials Unbalanced Indicator','Boolean','organization.latestFinancials.isUnbalanced','latestfin_isunbalanced','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (916,'The date when the financial statement records in Dun & Bradstreet were updated.','Latest Financials Last Update Date','String','organization.latestFinancials.lastUpdateDate','latestfin_lastupdatedate','2018-02-03');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (917,'The comments provided by a representative or member of the board of the entity.','Latest Financials Management Interview','String','organization.latestFinancials.managementInterview','latestfin_managementinterview','Member comments are here.  May be more comments.');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (918,'Describes the supplier of the Financial Statement (e.g., Official Registry, Accountant, the Subject).','Latest Financials Source Text','String','organization.latestFinancials.nonSpecificSource.description','latestfin_nonspecificsource_desc','Trustee');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (919,'A unique code assigned by Dun & Bradstreet to identify, in general terms, the supplier from which this data was originally obtained by Dun & Bradstreet.','Latest Financials Non-Specific Source D&B Code','Integer','organization.latestFinancials.nonSpecificSource.dnbCode','latestfin_nonspecificsource_code','15735');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (920,'Describes why the financial statement is not an official examination of the accounts (e.g., accounts from internal ledger with no external review, accountant limited review with no signature).','Latest Financials Reason Text','String','organization.latestFinancials.notAuditedReason.description','latestfin_notauditedreason_desc','Internally prepared book figures');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (921,'A unique code assigned by Dun & Bradstreet to identify the reason why the accounts have not been audited.','Latest Financials Not Audited Reason D&B Code','Integer','organization.latestFinancials.notAuditedReason.dnbCode','latestfin_notauditedreason_code','15657');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (922,'The value of merchandise purchased on credit and not paid for by the balance sheet date; also  known as Trade Creditors. In Italy, Accounts Payable include Cambiali Creditors where applicable.','Latest Financials Accounts Payable','Double','organization.latestFinancials.overview.accountsPayable','latestfin_overview_accountspayable','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (923,'The value of sales made and billed to customers on credit terms (i.e., money owed by customers and not yet received); also known as Trade Debtors. The value may or may not be net of bad debts. In Italy, Accounts Receivable include Cambiali Debtors where applicable. The accounts receivable amount is an asset to the company.','Latest Financials Accounts Receivable','Double','organization.latestFinancials.overview.accountsReceivable','latestfin_overview_accountsreceivable','2567890');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (924,'The ratio that measures the ability of an entity to use its near cash or quick assets to extinguish or retire its current liabilities immediately. It is calculated by dividing Total Liquid Assets by Current Liabilities.','Latest Financials Acid Test Ratio','Double','organization.latestFinancials.overview.acidTestRatio','latestfin_overview_acidtestratio','0.26');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (925,'The total value of cash held either on hand (e.g., in a bank) or in assets that can be quickly converted into cash and that have not been recorded elsewhere.','Latest Financials Cash and Other Liquid Assets','Double','organization.latestFinancials.overview.cashAndLiquidAssets','latestfin_overview_cashandliquidassets','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (926,'The cost of the materials, labor, overheads, etc. necessary to produce goods or services; also known as Cost of Sales.','Latest Financials Cost of Sales','Double','organization.latestFinancials.overview.costOfSales','latestfin_overview_costofsales','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (927,'The ratio that indicates the reliance on the equity for payment of debt. It is calculated by Current liabilities over Net worth expressed as a percentage. It is one of the measures of the solvency of an entity and, as a rule of thumb, should not exceed 60 percent; higher percentages mean significant pressure on future cash flows.','Latest Financials Current Liability Over Networth','Double','organization.latestFinancials.overview.currentLiabilitiesOverNetWorth','latestfin_overview_currentliabilitiesovernetworth','45.12');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (928,'The ratio that expresses the working capital relationship of current assets to cover current liabilities.','Latest Financials Current Ratio','Double','organization.latestFinancials.overview.currentRatio','latestfin_overview_currentratio','1.463');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (929,'The payment to principals or declared by a company\'s board of directors and given to its shareholders out of the entity\'s current or retained earnings.','Latest Financials Dividends and Withdrawals','Double','organization.latestFinancials.overview.dividends','latestfin_overview_div','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (930,'The total value of long term tangible assets held for business use and not expected to be converted to cash in the current or upcoming fiscal year. Examples include real estate (buildings and land), manufacturing equipment, and furniture.','Latest Financials Total Fixed Assets','Double','organization.latestFinancials.overview.fixedAssets','latestfin_overview_fixedassets','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (931,'The difference between Sales Revenue and Cost of Sales before the deduction of selling, distribution, administration, and other costs.','Latest Financials Gross Income','Double','organization.latestFinancials.overview.grossProfit','latestfin_overview_grossprofit','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (932,'The original value (before any amortization) of Intangible Assets (i.e., Fixed / Long Term Asset) that cannot be seen, touched, or physically measured.','Latest Financials Intagible Assets','Double','organization.latestFinancials.overview.intangibleAssets','latestfin_overview_intangibleassets','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (933,'The sum of line items that represents the raw materials, work-in-process goods, and completely finished goods that are considered to be the portion of an entity\'s assets that are ready or will be ready for sale. Note: this line item is used when there are sub-line items that are added together to derive this amount.','Latest Financials Inventory','Double','organization.latestFinancials.overview.inventory','latestfin_overview_inventory','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (934,'The money employed in a firm that has been borrowed from external sources for fixed periods of time by the issue of fixed-interest financial securities; also known as Loan Capital.','Latest Financials Long Term Debt','Double','organization.latestFinancials.overview.longTermDebt','latestfin_overview_longtermdebt','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (935,'Net Assets (or capital employed) is calculated as total assets less current liabilities.','Latest Financials Net Assets','Double','organization.latestFinancials.overview.netAssets','latestfin_overview_netassets','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (936,'The Net Profit or Loss before dividends are deducted for the quoted financial period.','Latest Financials Net Income','Double','organization.latestFinancials.overview.netIncome','latestfin_overview_netincome','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (937,'The total value of share capital/stock originally invested by shareholders/stockholders plus any reserves that have arisen, such as retained profits, and ben ploughed back into the firm; also known as Total Equity.','Latest Financials Total Equity Amount','Double','organization.latestFinancials.overview.netWorth','latestfin_overview_networth','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (938,'The profit from business operations (gross profit minus operating expenses) before deduction of interest and taxes.','Latest Financials Operating Profit','Double','organization.latestFinancials.overview.operatingProfit','latestfin_overview_operatingprofit','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (939,'The difference between Sales Revenue and all costs prior to the deduction of any tax liability.','Latest Financials Profit or Loss Before Tax','Double','organization.latestFinancials.overview.profitBeforeTaxes','latestfin_overview_profitbeforetaxes','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (940,'The ratio that measures the extent to which an entity can cover its current liabilities with those current assets that are readily convertible to cash. This is calculated by comparing all the Total Current Assets of an entity to all the Total Current Liabilities just like the Current Ratio, but the Inventories are subtracted from the Current Assets.','Latest Financials Quick Ratio','Double','organization.latestFinancials.overview.quickRatio','latestfin_overview_quickratio','1.1872');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (941,'The value of profits of the business that have not been paid out to the owners as of the balance sheet date. The earnings have been &quot;retained&quot; for use in the business. (Deficit reflects a Loss).','Latest Financials Retained Earnings','Double','organization.latestFinancials.overview.retainedEarnings','latestfin_overview_retainedearnings','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (942,'The income received from customers from the sale of the entity\'s goods and/or services; calculated as gross sales minus any returns, rebates/discounts, allowances for damages or shortages, shipping expenses passed on to the customer, and amounts due where there is not a reasonable expectation of collection.Note: Unless specified otherwise, currency displayed is in USD.','Latest Financials Sales Revenue Amount','Double','organization.latestFinancials.overview.salesRevenue','latestfin_overview_salesrevenue','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (943,'The tangible net work is calculated by taking the value of the entity\'s total assets and subtracting the value of intangible assets like goodwill, trademarks, patents, and so forth. This is an approximate figure and may not necessarily relate to any specific financial period.','Latest Financials Tangible Networth Amount','Double','organization.latestFinancials.overview.tangibleNetWorth','latestfin_overview_tangiblenetworth','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (944,'The total value of Current Assets and Total Long Term Assets. This includes all of the assets used by an entity no matter how they are financed.','Latest Financials Total Assets Amount','Double','organization.latestFinancials.overview.totalAssets','latestfin_overview_totalassets','512345');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (945,'The value of assets that are held for short term conversion as raw materials are bought, made up, sold as finished goods, and eventually paid for.','Latest Financials Total Current Assets','Double','organization.latestFinancials.overview.totalCurrentAssets','latestfin_overview_totalcurrentassets','512345');
