      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1237,'Indicates whether the entity operates as a concessionaire at one of the nation\'s airports and meets the ownership eligibility requirements as set forth by the regulations outlined in 49 CFR Part 23.- If true, entity is classified as airport concession disadvantaged business enterprise','Airport Concession Disadvantaged Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isAirportConcessionDisadvantagedBusinessEnterprise','socioeconomicinfo_bdc3365d956d027ba95a28ed03c48163','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1238,'Indicates whether the entity is determined to be an Alaskan Native Corporation, according to the law enacted by the Congress in December 1971, the Alaska Native Claims Settlement Act 1 to resolve long-standing original land claims and to foster economic development for Alaska Natives. This legislation created Alaska Native corporations ANC, which would become the vehicle for distributing land and monetary benefits to Alaska Natives in lieu of a reservation system.  In 1986, legislation passed that allowed ANC-owned businesses to participate in the Small Business Administration programs one of the federal government as primary means for developing small businesses owned by socially and economically disadvantaged individuals.- If true, this entity is classified as Alaskan Native Corporation','Alaskan Native Corporation Indicator','Boolean','organization.socioEconomicInformation.isAlaskanNativeCorporation','socioeconomicinfo_isalaskannativecorporation','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1239,'When set to \"true\", it indicates that the business is small, certified by a federal, state or local  government agency or organization as having met all of the government standards that award eligibility.','Certified Small Business Indicator','Boolean','organization.socioEconomicInformation.isCertifiedSmallBusiness','socioeconomicinfo_iscertifiedsmallbusiness','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1240,'Indicates whether the entity is certified as a business that is greater than a required percentage owned by, and whose management and daily business operations are controlled by, one or more persons who have a condition that prevents the person from performing all usual physical or mental functionsNote: The percentage of ownership requirement may differ by country. For example, in the US, for a business to be considered disabled owned, the percentage of ownership must be at least 51%.- If true, the entity meets the requirement for a disabled owned business','Disabled Owned Indicator','Boolean','organization.socioEconomicInformation.isDisabledOwned','socioeconomicinfo_isdisabledowned','null');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1241,'When set to \"true\", it indicates that the business is recognized by the state of California, meaning a veteran of the U.S. military, naval, or air service, with a service-connected disability of at least 10% or more and who is a California resident; where at least 51% is owned by disabled veteran/s and conducts daily business management and control.  The home office can not be a branch or subsidiary of a foreign corporation, foreign firm or other foreign-based business.','Disabled Veteran Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isDisabledVeteranBusinessEnterprise','socioeconomicinfo_isdisabledveteranbusinessenterprise','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1242,'Indicates whether the entity is certified by a federal, state, or local government agency as having met all of the government standards that award eligibility, but may include women, minority, disabled, and other disadvantaged businesses as a result of economic disadvantages with respect to education, employment, residence or business location, or social disadvantage and lack of business training.- If true, entity is certified as disadvantaged business','Disadvantaged Business Indicator','Boolean','organization.socioEconomicInformation.isDisadvantagedBusiness','socioeconomicinfo_isdisadvantagedbusiness','true');
