      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1246,'Indicates if the entity is certified as woman owned. A woman owned entity is one that is greater than 50% owned by, and whose management and daily business operations are controlled by, one or more women.- If true, it is woman owned business','Woman-Owned Indicator','Boolean','organization.socioEconomicInformation.isFemaleOwned','socioeconomicinfo_isfemaleowned','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1247,'When set to \"true\", it indicates that this organization is at least fifty-one percent (51%) owned, operated, managed, and controlled by an LGBT person or persons who are either U.S. citizens or lawful permanent residents. Exercise independence from any non-LGBT business enterprise, have its principle place of business (headquarters) in the United States and have been formed as a legal entity in the United States to obtain certification.','LGBTQ Owned Indicator','Boolean','organization.socioEconomicInformation.isLGBTQOwned','socioeconomicinfo_islgbtqowned','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1248,'Indicates whether the entity is defined as a small business concern which is organized for profit and located within a pre-determined radius of a communitie\'s Mile Marker. The average gross receipts, based on the firm\'s last three years of receipts, must not exceed the small business size standard established by the Authority for the services or goods that will be provided in an Authority contract. The receipts of all affiliates are counted in determining size. Business concerns are affiliates of each other when, either directly or indirectly, (1) one concern controls or has the power to control the other, or (2) a third party (or parties) has the power to control both. Consideration is given to such factors as common ownership and management, contractual relationships and overlapping authority.- If true, this entity is a local disadvantaged business enterprise','Local Disadvantaged Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isLocalDisadvantagedBusinessEnterprise','socioeconomicinfo_islocaldisadvantagedbusinessenterprise','null');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1249,'When set to \"true\", it indicates that the business is certified by a federal, state or local government agency through an application and/or premise visit process as having met all of the government standards and requirements.','Minority Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isMinorityBusinessEnterprise','socioeconomicinfo_isminoritybusinessenterprise','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1250,'Indicates if the entity is minority owned.  Minority owned means it is certified as an entity that is greater than 50% owned by and whose management and daily operations are controlled by one or more minority group members- If true, indicates that this is a minority-owned entity','Minority Owned Indicator','Boolean','organization.socioEconomicInformation.isMinorityOwned','socioeconomicinfo_isminorityowned','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1251,'Indicates that this organization is a college or university where the profile of the majority of students is of minority ethnicity. For example, if maximum percentage of students in a college or university are from black ethnicity, this would be a \'Minority College\' with black ethnicity type. An example of Minority College is \'Delaware State University\'. - If true, this is a minority serving institution','Minority Serving Institution Indicator','Boolean','organization.socioEconomicInformation.isMinorityServingInstitution','socioeconomicinfo_isminorityservinginstitution','null');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1252,'When set to \"true\", it indicates that the business is at least 51% owned by one or more veterans with a disability that is service connected.  The term \"service connected\" means, with respect to disability or death, that such disability was incurred or aggravated, in the line of duty in the active military, naval or air service.','Service Disabled Veteran Owned Indicator','Boolean','organization.socioEconomicInformation.isServiceDisabledVeteranOwned','socioeconomicinfo_isservicedisabledveteranowned','TRUE');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1253,'Indicates if the business qualifies as small business, eligible for assistance from SBA, with a place of business located in the United States. It must operate primarily within the United States or make a significant contribution to the U.S. economy through payment of taxes or use of American products, materials or labor. Together with its affiliates, it must meet the numerical size standards as defined in the Small Business Size Regulations 13 CFR 121.- If true, indicates that this is a small business.- If false, indicates that this is not a small business','Small Business Indicator','Boolean','organization.socioEconomicInformation.isSmallBusiness','socioeconomicinfo_issmallbusiness','true');
