      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1256,'Indicates whether the entity is certified by a national, territorial or local government agency as having met all of the government standards that award eligibility and is atleast 51% owned by a person who served in the active military, naval, or air service, and who was discharged or released therefrom under conditions other than dishonorable. In the U.S., a veteran-owned business is one that is at least 51% owned by, and whose management and daily business operations are controlled by, one or more veterans.- If true, the entity is a certified Veteran Business Enterprise','Veteran Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isVeteranBusinessEnterprise','socioeconomicinfo_isveteranbusinessenterprise','null');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1257,'Indicates whether the entity is certified as a business that is greater than the required percentage owned by, and whose management and daily business operations are controlled by, one or more veterans. A veteran refers to a person who served in the active military, naval, or air service, and who was discharged or released therefrom under conditions other than dishonorable. Note: The percentage of ownership requirement may differ by country. For example, in the US, for a business to be considered veteran owned, the percentage of ownership must be at least 51%.- If true, the entity meets the requirement for a veteran owned business.- If false, the entity does not meet the requirement for a veteran owned business.','Veteran Owned Indicator','Boolean','organization.socioEconomicInformation.isVeteranOwned','socioeconomicinfo_isveteranowned','true');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1258,'Indicates whether the entity is a least 51% owned by one or more Vietnam Veterans who served between Jan 1, 1959 and May 7, 1975 and have control of and operate the business.  Control in this context means exercising the power to make policy decisions and operate means to be actively involved in the day-to-day management of the business.- If true, the entity meets the requirement for a Vietnam veteran owned business','Vietnam War Veteran Owned Indicator','Boolean','organization.socioEconomicInformation.isVietnamVeteranOwned','socioeconomicinfo_isvietnamveteranowned','true');
