      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1260,'Indicates whether the business is certified by a federal, state or local government agency as having met all of the government standards and requirements that award eligibility, and with a woman owning atleast 51% ownership of the business.- If true, this entity is Woman Business Enterprise','Woman Business Enterprise Indicator','Boolean','organization.socioEconomicInformation.isWomanOwnedBusinessEnterprise','socioeconomicinfo_iswomanownedbusinessenterprise','null');
      INSERT INTO `LDC_ManageDB`.`PrimeColumn` (`PID`,`Description`,`DisplayName`,`JavaClass`,`JsonPath`,`PrimeColumnId`,`Example`) VALUES (1261,'Indicates whether the entity qualifies as a women-owned small business (WOSB), for which the business must meet the following requirements identified in 13 CFR 127.200, 201, and 202:	Meet the small business size standard for the primary NAICS code and contract 	Be at least 51% unconditionally and directly owned by women who are U.S. citizens	Women must manage the day-to-day operations	Women must make the long-term decisions for the business	A woman must the hold highest officer position in the business	This woman must work at the business full-time during normal working hours.	No minimum amount of time for the business to be operational- If true, the entity is a Woman owned small business','Woman Owned Small Business Indicator','Boolean','organization.socioEconomicInformation.isWomanOwnedSmallBusiness','socioeconomicinfo_iswomanownedsmallbusiness','TRUE');
